import React, { Component } from 'react';
import {
  Container, Row, Col
}                           from 'reactstrap';

import logo                 from '../../assets/logo.png';

class App extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col xs="12" className="text-center">
            <img src={logo} alt="Christ Fellowship Logo" className="w-50 h-auto"/>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
